import { useState } from 'react'
import { 
    Typography
} from '@mui/material'

import MainTemplate from '../templates/mainTemplate'
import HeaderAppBar from '../molecules/hesderAppBar'

function MainPage () {
    const menus = [
        { name: '新規登録', path: '/createPayment' },
        { name: '分析', path: '/analysis' },
    ]

    return(
        <div>
            <HeaderAppBar
                title={'お支払い一覧'}
                menus={menus}
            />
            <MainTemplate/>

        </div>
    )
}

export default MainPage
